import React from 'react'

const Employees = () => {
  return (
    <div class="flex justify-center items-center font-sans max-w-2xl bg-green-400">
        <table>
            <thead>ID</thead>
            <thead>Name</thead>
            <thead>Designation</thead>
            <thead>Salary</thead>
        </table>
    </div>
  );
}

export default Employees;
